import React from 'react'

function BlogList({ blogs, title }) {


    return (
        <div>
            <h2>{ title }</h2>
            <div className="blog-list">
                {blogs.map((blog) => (
                    <div className="blog-preview" key={blog.id}>
                        <Link to={``}>
                            <h2>{ blog.title }</h2>
                            <p>Written By: { blog.author }</p>
                        </Link>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default BlogList
